import React from 'react';
import { CatagoryFullinfos } from './CatagoryFullinfos';
import CatagoryCard from './CatagoryCard'; // Import the card component

import styles from './Catagory.module.css';

function Catagory() {
    return (
        <section className={styles.catagory_container}>
            {CatagoryFullinfos.map((category, index) => (
                <CatagoryCard key={category.name || index} data={category} />  ,{/* Pass each category to CatagoryCard */}
            ))}
        </section>
    );
}

export default Catagory;
